import { handleActions, createAction } from "redux-actions";

// initial state

const initialState = {
    mainPosts: [
        {
            id: 1,
            user: {
                id: 1,
                nickname: "jinho",
            },
            content: "첫번쨰 게시글",
        },
        {
            id: 2,
            user: {
                id: 4,
                nickname: "jinho4",
            },
            content: "4첫번쨰 게시글",
        },
        {
            id: 3,
            user: {
                id: 11,
                nickname: "jinho11",
            },
            content: "11첫번쨰 게시글",
        },
    ],
};

// action type

// action creator

// reducer

const reducer = handleActions({}, initialState);

export default reducer;
